const TestimonialThumbnail = ({ imgURL, activeImage, changeActiveImage }) => {
    
    function handleClick() {
        if (activeImage !== imgURL.imgURI) {
            changeActiveImage(imgURL.imgURI)
        }
    }

    return (
        <img src={imgURL.imgURI} alt={imgURL.label}  onClick={handleClick} />
    );
};

export default TestimonialThumbnail;
